import React from "react";
import { useState } from "react";
import axios from "axios";
import { useHistory } from "react-router-dom";
import user_image from "../assets/images/useravatar.png";

const Profile = () => {
  const history = useHistory();
  if (localStorage.getItem("id") === null) {
    //check condition
    history.push("/login");
  }
  React.useEffect(async () => {}, []);
  return (
    <div>
      {" "}
      <h2 className="page-header">Profile PaGES</h2>
      <div className="card col-8">
        <div className="row">
          <div className="col-3"></div>
          <img src={user_image} style={{ height: "250px", width: "250px" }} />
        </div>

        <br></br>

        <h3>UserName :</h3>
        <div> {localStorage.getItem("username")}</div>
        <br></br>
        <h3>Restaurant Description :</h3>
        <div> {restoData.description} </div>
        <br></br>
        <h3>Restaurant Speciality :</h3>

        <div> {restoData.speciality} </div>
        <br></br>
        <button
          onClick={() => openEditRestofore(restoData)}
          className="button col-2"
        >
          Edit
        </button>
        <br></br>
      </div>
      <div className="row">
        <div className="user__image">
          <img className="user__image" alt="" />
        </div>
        <div className="topnav__right-user__name"></div>
      </div>
    </div>
  );
};

export default Profile;
